import React from "react";
import styled from "styled-components";
import Item from "../Item/Item";

const items = [
  {
    id: 1,
    name: "NikeCourt Tech Challenge 20",
    price: "$165",
    newPrice: undefined,
    options: "2 colors",
    info: "released",
  },

  {
    id: 2,
    name: "Nike Mecton 5 AMP",
    price: "$165",
    newPrice: "$145",
    options: "1 color",
    info: "sale",
  },
  {
    id: 3,
    name: "Nike Phantom Vision",
    price: "$165",
    newPrice: undefined,
    options: "4 colors",
    info: "released",
  },

  {
    id: 4,
    name: "Nike Air Zoom Pegasus 36 Trail",
    price: "$165",
    newPrice: undefined,
    options: "2 colors",
    info: undefined,
  },

  {
    id: 5,
    name: "Nike Joyride Dual Run",
    price: "$170",
    newPrice: "$150",
    options: "2 colors",
    info: "sale",
  },

  {
    id: 6,
    name: "Nike Tiempo Legend 8 Academy TF",
    price: "$165",
    newPrice: "$138",
    options: "2 colors",
    info: "sale",
  },
];

const ItemGrid = () => {
  return (
    <Wrapper>
      {items.map((item) => (
        <Item>{item}</Item>
      ))}
    </Wrapper>
  );
};

const Wrapper = styled.div`
  display: flex;
`;

export default ItemGrid;
